    let [inputReservationInfoModal, setInputReservationInfoModal] = useState(false);

    //alert('In Hotel_MerchantHomePage')

    return (

                <IonFooter className='appFooter'>
                    <IonGrid>
                        <IonRow>
                            <IonCol size='12'>
                                {/*<IonButton  onClick={() => setShowContactInfoModal(true)}>CONTACT</IonButton>*/}
